import React from "react";
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <div>
      <h1>This is Navabar</h1>
      <NavLink>Home</NavLink>
      <NavLink>About</NavLink>
      <NavLink>contact</NavLink>
    </div>
  );
};
export default Navbar;
